--[ REMOVE FUNCTION ]

IF EXISTS (SELECT * FROM    sys.objects WHERE   object_id = OBJECT_ID(N'tcp___number') AND type IN ( N'F', N'FS' )) DROP FUNCTION tcp___number;
IF EXISTS (SELECT * FROM    sys.objects WHERE   object_id = OBJECT_ID(N'tcp___text') AND type IN ( N'F', N'FS' )) DROP FUNCTION tcp___text;

IF EXISTS (SELECT * FROM    sys.objects WHERE   object_id = OBJECT_ID(N'valid___number') AND type IN ( N'F', N'FS' )) DROP FUNCTION valid___number;
IF EXISTS (SELECT * FROM    sys.objects WHERE   object_id = OBJECT_ID(N'valid___number_yyyyMMdd') AND type IN ( N'F', N'FS' )) DROP FUNCTION valid___number_yyyyMMdd;
IF EXISTS (SELECT * FROM    sys.objects WHERE   object_id = OBJECT_ID(N'valid___number_HHmmss') AND type IN ( N'F', N'FS' )) DROP FUNCTION valid___number_HHmmss;

